function Note(props) {
    const notes = [
        {
            id:1,
            title:"title1",
            content:"content1"
        },
        {
            id:2,
            title:"title2",
            content:"content2"
        },
        {
            id:3,
            title:"title3",
            content:"content3"
        },
    ]
  return (
    <h2 className='note'>
        {notes.map((note,index)=>{
            return <h2 key={index}>{note.title}</h2>
        })}
    </h2>
  )
}

export default Note
